import React, { useState } from 'react';

const Register = () => {
const[username,setUsername]=useState

  // Define inline styles
  const formStyle = {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    height: '100vh',
    backgroundColor: '#f9f9f9',
  };

  const inputStyle = {
    padding: '10px',
    margin: '10px 0',
    width: '300px',
    border: '1px solid #ccc',
    borderRadius: '5px',
    fontSize: '16px',
  };

  const buttonStyle = {
    padding: '10px 20px',
    backgroundColor: '#008CBA', // Different color for the register button
    color: 'white',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
    fontSize: '16px',
  };

  const buttonHoverStyle = {
    backgroundColor: '#007bb5',
  };

  return (
    <form style={formStyle}>
      <input type="text" placeholder="username" style={inputStyle} />
      <input type="password" placeholder="password" style={inputStyle} />
      <button style={{ ...buttonStyle, ':hover': buttonHoverStyle }}>Register</button>
    </form>
  );
}

export default Register;
